description:
职位描述
岗位职责：
1. 负责项目Python开发，数据处理；
2.负责项目逻辑设计及模块开发。
岗位要求:
1.计算机相关专业本科以上学历；
2.3年以上python后台开发经验，精通python网络编程，熟悉Django web开发框架；
3.熟悉spark,hadoop,elasticsearch等大数据平台的原理，做过大数据分析平台项目;
4.对MySQL，Redis,MongoDB等数据库至少有两种开发经验。

岗位职责:
1.参与云计算相关产品的web自动化框架的开发和维护；
2.参与云计算相关产品的web自动化脚本开发;
岗位要求:
1.2年及以上Python开发经验;
2.精通Python编程，对html,css,js有一定了解;
3.熟悉Selenium框架的使用;
4.了解基本的shell命令和Linux环境使用;
5.学习能力强，能快速学习并使用新技术开发;
6.了解基本的Java优先考虑。
